import React from "react";
import MainImage from '../images/stoimost.png'

export const Wrapper = ({ children }) => {
    return (
        <header>
        <div className="container mx-auto py-5 px-7 min-h-screen">{ children }
        </div>
        <section className='brightness-75'>
        <img src={ MainImage } alt='' className=''></img>
        </section>
        </header>
    )
}
